N° 2401002 Lot n° 01 Fourniture et pose de panneaux d’information touristique, culturelle
'exécution des prestations suivantes : 
- Fourniture et réalisation de panneaux d’information culturelle, touristique et divers ; 
- Fourniture et réalisation des supports de fixation des panneaux ; 
- Réalisation de la livraison, pose et dépose des panneaux et des supports de fixation ; 
- Intervention à la ½ journée pour maintenance de panneaux ou autres demandes.
Ces prestations auront lieu sur l'ensemble du territoire de SAINT-MARTIN. 
La Collectivité de Saint-Martin couvre une superficie de 90 km²

Liste des opérateurs ou catégories d'opérateurs documentés dans le jaune budgétaire du PLF 2025 : https\://www\.budget.gouv.fr/documentation/file-download/27620
En PLF 2025, le nombre d’opérateurs diminue de quatre unités, notamment dans le cadre de la fusion de l’IRSN et de l’ASN pour former l’ASNR, une autorité administrative indépendante (AAI) se substituant à une AAI et un opérateur, et de la dissolution de 2 COMUE :
\- l’Institut de radioprotection et de sûreté nucléaire (IRSN) dans le cadre de sa fusion avec l’Autorité de sûreté nucléaire (ASN) au sein de l’Autorité de sûreté nucléaire et de radioprotection (ASNR), nouvelle autorité administrative indépendante sur le programme 235 « Sûreté nucléaire et radioprotection » ;
\- le GIP « France enfance protégée », retiré de la liste des opérateurs du PLF 2025 à la suite d’un accord en ce sens entre le Gouvernement et l’Association des départements de France (ADF) ;
\- la communauté d’universités et d’établissements Paris-Lumières et la communauté d’universités et d’établissements HESAM (Hautes Études en Sciences Arts et Metiers), suite à leur dissolution.

Les servitudes PM4 sont relatives aux zones de rétention d'eau, aux zones de mobilité des cours d'eau, et aux zones dites "stratégiques pour la gestion de l'eau" et portent sur
- la création de zones de rétention temporaire des eaux de crues ou de ruissellement, par des aménagements permettant d'accroître artificiellement leur capacité de stockage de ces eaux, afin de réduire les crues ou les ruissellements dans des secteurs situés en aval ;
- la création ou la restauration des zones de mobilité du lit mineur d'un cours d'eau en amont des zones urbanisées dans des zones dites " zones de mobilité d'un cours d'eau ", afin de préserver ou de restaurer ses caractères hydrologiques et géomorphologiques essentiels ;
- la préservation ou la restauration des zones humides dites "zones stratégiques pour la gestion de l'eau" délimitées par le plan d'aménagement et de gestion durable de la ressource en eau et des milieux aquatiques d'un schéma d'aménagement et de gestion des eaux (SAGE).
Cette ressource décrit les assiettes de servitude PM4, à savoir le contour du périmètre défini par le plan de délimitation annexé à l'arrêté préfectoral instaurant la servitude
Remarque : pour cette servitude, le générateur et l'assiette se superposent et se confondent

Le plan national Action cœur de ville répond à une double ambition : améliorer les conditions de vie des habitants des villes moyennes et conforter le rôle de moteur de ces villes dans le développement du territoire.
Signes de ce rôle structurant essentiel : 23 % de la population française vivent dans les villes moyennes, et 26 % de l’emploi total, en France, y sont concentrés. Ces villes sont sources de dynamisme économique, patrimonial, culturel et social, mais elles connaissent parfois des difficultés d’attractivité, de logements dégradés ou de vitalité commerciale, par exemple.
Élaboré en concertation avec les élus et les acteurs économiques des territoires, le plan Action cœur de ville vise à faciliter et à soutenir le travail des collectivités locales, à inciter les acteurs du logement et de l’urbanisme à réinvestir les centres-villes, à favoriser le maintien ou l’implantation d’activités en cœur de ville afin d’améliorer les conditions de vie dans les villes moyennes. 
Action coeur de ville 2 se concentre sur 4 priorités principales : 
    Accompagner les villes pour relever le défi de la transition écologique;
    Conforter le socle de services, le vivier d'emploi et le rôle de centralité des villes moyennes pour l'ensemble de leur territoire;
    Revitaliser prioritairement leur centre-ville afin d'y (re)mettre habitants et activités dans un cadre de vie accueillant, agréable et inclusif;
    Accélérer le passage à l'opérationnel des actions, en apportant aux villes l'accompagnement nécessaire à la mise en oeuvre de projets transversaux plus complexes et des financements adaptés.

Les zones humides remarquables sont les zones humides qui abritent une biodiversité exceptionnelle. Elles correspondent aux zones humides intégrées dans les inventaires des espaces naturels sensibles* d’intérêt au moins départemental note, ou à défaut, aux Zones naturelles d’intérêt écologique floristique et faunistique (ZNIEFF)*, aux zones Natura 2000* ou aux zones concernées par un arrêté de protection de biotope* et présentent encore un état et un fonctionnement biologique préservé a minima. Leur appartenance à ces zones ou à ces inventaires leur confère leur caractéristique de zone humide remarquable. Elles imposent la constitution d’inventaires détaillés. Ces derniers sont déjà initiés mais encore incomplets.
Des zones dites remarquables ont été identifiées dans le bassin Rhin-Meuse et constituent autant de priorités d’actions pour la préservation. Elles représentent 35 000 ha, soit de l’ordre de 4,2% de la surface du bassin réparties en :
    40% de forêts humides ;
    35% de prairies humides ;
    18% d’étangs et mares ;
    6% de marais et de tourbières.

