Périmètres supra-départementaux des Etablissements public de coopération intercommunale (EPCI) (à fiscalité propre ou autres).
Dans le département des Vosges depuis le 1er janvier 2022 (13 EPCI).
Fond cartographique ©IGN-F/ADMIN EXPRESS® 
Ces EPCI sont des regroupements de communes ayant pour objet l'élaboration de « Projets communs de développement au sein d'un périmètre de solidarité ». Ils sont soumis à des règles communes, homogènes et comparables à celles de collectivités locales.
Les informations présentées ici concernent les EPCI à fiscalité propre :
    Communauté Urbaine (CU) ;
    Communauté d'Agglomération (CA) ;
    Communauté de Communes (CC) ;
    Syndicat d'Agglomération Nouvelle (SAN) ;
    Métropole (ME).
Il existe par ailleurs des EPCI sans fiscalité propre : les Syndicats Intercommunaux à Vocation Unique (SIVU), les Syndicats Intercommunaux à Vocation Multiple (SIVOM), les Syndicats Mixtes fermés (SM fermés) et les Syndicats Mixtes ouverts (SM ouverts).
La liste des EPCI à fiscalité propre est téléchargeable sur le site de l'INSEE.
